import { BrowserRouter, NavLink, Route, Routes } from "react-router-dom"
import classessGreg from './Dialogs.module.css'



const dialogs = [
    {
        id: 1,
        name: 'Valera'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Elena'
    }
]


const messages = [
    {
        id: 1,
        name: 'Hy My name is Petr'
    },
    {
        id: 2,
        name: 'MI dont belive youark'
    },
    {
        id: 3,
        name: 'Elena I dont belive you'
    }
]

const DialogItem = (props)=> {
    const link = props.link + props.id
    return <li><NavLink to={link}> {props.name} </NavLink></li>
}

const Message = (props)=> {
    return <div>
        {props.message}
    </div>
}

const Dialogs = (props)=> {
    return <div className={classessGreg.dialogs}>
        <ul>
        {dialogs.map(item => <DialogItem link='/dialogs/' key={item.id} id={item.id} name={item.name} />)}
        </ul>
        <div>
            <Message message='Hy My name is Petr'/>
            <Message message='I dont belive you '/>
        </div>
    </div>
}

export default Dialogs
